import React from 'react';
import {Link} from "react-router-dom";
import {getRole} from "../../extensions/encryption";

const Header = () => {
    return (
        <div className="container-fluid ">
            <div className="row">
                <div className="col-xl-12" style={{backgroundColor: '#2B2D42', boxShadow: '5px 3px 25px black'}}>
                    <div className="container">
                        <div className="row">
                            <div className="col-xl-1 col-3 text-start">
                                <Link style={{textDecoration: 'none'}} to="/"><h3 style={{color: 'white'}}>WebTech</h3></Link>
                            </div>
                            <div className="col-xl-3 col-10 text-xl-center px-3 mt-xl-2">
                                <Link style={{textDecoration: 'none'}} to="/addingArticle"><h6 style={{color: 'white'}}>How to become an author</h6></Link>
                            </div>

                            <div className="col-xl-4 col-10 text-xl-start">
                                {getRole() !== undefined ? (
                                    <Link style={{textDecoration: 'none'}} to="/PersonalArea"><h3 style={{color: 'white'}}>PERSONAL AREA</h3></Link>
                                ):(
                                    <Link style={{textDecoration: 'none'}} to="/Login"><h1 style={{color: 'white'}}>LOGIN</h1></Link>
                                )}
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default Header;
